;; **
;;; ## Inference
;; **

;; @@
(def test-observations [1 1 1 1 1 1 2 2 2 2])
(def posterior-plot (plt/plot #(Math/exp (observe* (gamma (+ 2 (sum test-observations)) (+ 2 (count test-observations))) %)) [0 10]))
(def prior-plot (plt/plot #(Math/exp (observe* (gamma 2 0.5) %)) [0 10] :plot-range [[0 10] [0 1.2]]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;worksheets.gamma-poisson/prior-plot</span>","value":"#'worksheets.gamma-poisson/prior-plot"}
;; <=

;; @@
(def num-particles 10)
(def csis-states (take num-particles (infer :csis gamma-poisson [test-observations])))
(plt/compose
  prior-plot
  posterior-plot
  (plt/histogram (repeatedly 1000 #(sample* (categorical (vec (stat/empirical-distribution (stat/collect-results csis-states)))))) :normalize :probability-density))
